<!doctype html>
<html>
	<head>
		<meta charset="utf-8" />
		<title>Test Object (IV)</title>
		<script>
function OnLoad()
{
	if(window.console && console.clear)
		console.clear();

	var
		data = [],
		o;

	for(var i=0; i<10; ++i)
	{
		o = {};
		for(var j=0x061; j<0x069; ++j)
			o[String.fromCharCode(j)] = "";
		data.push(o);
	}
}
		</script>
	</head>
	<body onload="OnLoad()">
	</body>
</html>
